feeds.query:
{
  allMarkdownRemark(
    limit: 1000,
    sort: { order: DESC, fields: [frontmatter___date] },
  ) {
    edges {
      node {
        excerpt
        html
        timeToRead
        fields { slug }
        frontmatter {
          title
          cover
          date
          category
          tags
        }
      }
    }
  }
}

