query BlogPostBySlug(
  $slug: String!
) {
  markdownRemark(fields: {slug: {eq: $slug}}) {
    html
    timeToRead
    excerpt
    frontmatter {
      title
      cover
      date
      category
      tags
    }
    fields {
      nextTitle
      nextSlug
      prevTitle
      prevSlug
      slug
      date
    }
  }
}

query TagPage(
  $tag: String
) {
  allMarkdownRemark(limit: 1000, sort: {fields: [fields___date], order: DESC}, filter: {frontmatter: {tags: {in: [$tag]}}}) {
    totalCount
    edges {
      node {
        fields {
          slug
          date
        }
        excerpt
        timeToRead
        frontmatter {
          title
          tags
          cover
          date
        }
      }
    }
  }
}

query CategoryPage(
  $category: String
) {
  allMarkdownRemark(limit: 1000, sort: {fields: [fields___date], order: DESC}, filter: {frontmatter: {category: {eq: $category}}}) {
    totalCount
    edges {
      node {
        fields {
          slug
          date
        }
        excerpt
        timeToRead
        frontmatter {
          title
          tags
          cover
          date
        }
      }
    }
  }
}

