query CoverQuery {
  allFile {
    edges {
      node {
        id
        absolutePath
        childImageSharp {
          id
          resolutions {
            base64
            tracedSVG
            aspectRatio
            width
            height
            src
            srcSet
            srcWebp
            srcSetWebp
            originalName
          }
          internal {
            contentDigest
            type
            owner
          }
          fluid(maxWidth: 1240) {
            ...GatsbyImageSharpFluid
            originalName
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}
